function title_case(str) {
    str = str.toLowerCase().split(' ');
    for (var i = 0; i < str.length; i++) {
        str[i] = str[i].charAt(0).toUpperCase() + str[i].slice(1);   // can use substr
    };
    return str.join(' ');
};

function rand_choices(items, weights) {
    // chose item from items with weighted probability. e.g. items ['a','b'], weights [1,2]
    var sumweights = weights.reduce((a,b) => a+b, 0);
    var rr = Math.random()*sumweights;
    var cumsum = 0;
    for (let i=0; i < items.length; i++) {
        cumsum += weights[i];
        if (rr < cumsum) {
            return items[i];
        }; };
};
