function one_roll_from_tc(tc_name_str, players_str) {
    // Return a random selection (based on Item Probs) from a row (Treasureclass)
    // one_roll_from_tc('Andarielq (H)')   picks 7    ---    Act 2 Equip A	19    	Act 2 Good	3
    // Out[210]: 'Act 2 (H) Equip A'
    
    var rowdict = TCDICT[tc_name_str];
    var items = [], probs = [];
    try {
        var players_int = parseInt(players_str) || 1;
        if (players_int < 1) {
            players_int = 1;
        } else if (players_int > 8) {
            players_int = 8;
        }
    } catch(e) {
        var players_int = 1;
    };
    //no drop exponent.  /players 1 or 2 -> nd_exp 1,   3 or 4 -> nd_exp 2,    5 or 6 -> nd_exp 3,     7 or 8 -> nd_exp 4
    var nd_exp = parseInt(parseFloat(players_int)/2.0 + 0.5);
    
    for (const [k, v] of Object.entries(rowdict)) {
        if (k.startsWith("Item") && v) {
            //add item to item list and probability to prob list
            items.push(v);
            probs.push(parseInt(rowdict[`Prob${items.length}`]));
        }
    };
    if (rowdict['NoDrop']) {
        var nodrop_orig = parseInt(rowdict['NoDrop']);
        // .reduce((a, b) => a + b, 0)   https://stackoverflow.com/questions/1230233/how-to-find-the-sum-of-an-array-of-numbers
        var sumprobs = probs.reduce((a,b) => a+b, 0);
        var ratio = Math.pow(nodrop_orig/(nodrop_orig + sumprobs), nd_exp);

        var nodrop_final = ((ratio)/(1-ratio))*sumprobs;
        //do the dropcalcs take int() here? this could lead to diff avg drop %s, diff item drop %s.  item generation tutorial rounds 
        items.push('');
        probs.push(Math.round(nodrop_final));
    };
    //choice from a list with weighted probability.   // items[Math.floor(Math.random() * items.length)]  for uniform weights
    return rand_choices(items, probs);
};

